import React from 'react';

const PersonalCards = props => {

        return(
            <>
                <h1>{props.lastName}, {props.firstName}</h1>
                <h3>Age: {props.age}</h3>
                <h3>Hair Color: {props.hairColor}</h3>

            </>
        )

}
export default PersonalCards;
